package body pack is
    function getWindow(i,j : integer) return window_type is
        variable window : window_type ;
    begin
         for x in 0 to 2 loop
            for y in 0 to 2 loop
                window(x,y) := pic(i+x,j+y);
            end loop; end loop;
        return window ;
    end function ;
    shared variable seed1 , seed2 : integer ;
    impure function RandomFilterReal return filter_type is
        variable r : real;
        constant max: real := 1.00000001;
        constant min : real := -0.0000001;
        variable filter : filter_type ;
    begin
        for i in 0 to 2 loop
            for j in 0 to 2 loop
                uniform(seed1 ,seed2 ,r);
                filter(i,j) := r * (max - min) + min;
            end loop;
        end loop;
        return filter;
    end function ;

    impure function seed(s1,s2 : integer) return boolean is
    begin
        seed1 := s1;
        seed2 := s2;
        return TRUE ;
    end function;


end package body ;